import React from "react";
import "./UserList.css";

const UserList=(props)=>{
    console.log(props.UserArrayList[0].age);
    return(
        props.UserArrayList.map((element)=>{
            <p className="frame-p">{element.username +
                " ("+ element.age + " years Old)"}</p>
        })


    );
}

export default UserList;
